import React from 'react';


import Header from './components/Header';
import './App.css';
import Footer from './components/Footer';
import LayoutContainer from './components/LayoutContainer';

function App() {
  return (
    <LayoutContainer>
      <Header />
      <Footer />
    </LayoutContainer>
  );
}

export default App;
